import { VFlow } from "bold-ui";
import React, { Fragment } from "react";
import { AccordionFinalSummary } from "../components/AccordionFinalSummary";
import { RepeatComponent } from "../components/RepeatComponent";
import { Header } from "../components/Header";
import { PageContainer } from "../components/PageContainer";
import { mesasOcupadas } from "../components/Helpers";
import { ModalConfirm } from "../components/ModalConfirm";

export function FinalSummary() {
  const renderRepeatedContent = (index: number) => (
    <AccordionFinalSummary numDesk={index}></AccordionFinalSummary>
  );

  return (
    <Fragment>
      <ModalConfirm
        open={isModalConfirmOpen}
        onClose={() => setIsModalConfirmOpen(false)}
        onChange={() => setIsSubmitting(true)}
        title={"Confirmar reserva?"}
        description={"Deseja salvar suas alterações?"}
      ></ModalConfirm>
      <Header title="Finalizar"></Header>
      <PageContainer>
        <VFlow vSpacing={2}>
          {mesasOcupadas.map((value) => renderRepeatedContent(value))}
        </VFlow>
      </PageContainer>
    </Fragment>
  );
}
